import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Home from './pages/Home';
import Admin from './pages/Home/Admin';
import Catalog from './pages/Home/Catalog';

const Routes = () => (
<BrowserRouter>
<Switch>
<Route path="/" exact>
<Home />
</Route>
<Route path="/catalog">
<Catalog />
</Route>
<Route path="/admin">
<Admin />
</Route>
</Switch>
</BrowserRouter>
);
export default Routes;
